import React from "react";
import { Box, Button, Grid, Modal, TextField, createTheme } from "@mui/material";
import AddIcon from '@mui/icons-material/Add';
import { DragDropContext, Droppable } from "react-beautiful-dnd";
import { useDispatch } from "react-redux";
import { setShowModal } from "../../Reducers/DayReducer";
import { useSelector } from "react-redux";
import { ClassNames } from "@emotion/react";

const Day = () => {
    const dispatch = useDispatch();
    const showModal = useSelector(state => state.dayReducer.showModal);

    const AddTask = () => {
        dispatch(setShowModal(true));
    };

    const closeModal = () => {
        dispatch(setShowModal(false));
    }

    const onDragEnd = (result) => {
        
    };

    return (
        <>
            <Button
                variant='contained'
                sx={{
                    borderRadius: 5,
                    position: 'absolute',
                    top: '5%',
                    right: '10%'
                }}
                onClick={() => {AddTask()}}
            >
                <AddIcon />
            </Button>
        <Modal
            open={showModal}
            onClose={closeModal}
        >
            <Box minHeight={'20em'} width={'30em'} justifyContent={'center'} border={1} borderRadius={3} sx={{position: 'absolute', top: '30%', left: '33%', bgcolor: '#1c1c1c'}}>
                <Grid container>
                    <Grid item xs={12}>
                        <h1 style={{color: '#f5f5f5', marginLeft: '0.5em'}}>Add New Task</h1>
                    </Grid>
                    <Grid marginLeft={'1em'}>
                        <TextField sx={{bgcolor: 'secondary.dark'}} />
                    </Grid>
                </Grid>
            </Box>
        </Modal>
            <DragDropContext onDragEnd={onDragEnd}>
                <Grid container columnGap={8} rowGap={2} marginTop={'1em'} justifyContent={'center'}>
                    <Grid xs={3.33} marginLeft={'1em'} fontSize={35}>
                        Not Started
                    </Grid>
                    <Grid xs={3.33} fontSize={35}>
                        In Progress
                    </Grid>
                    <Grid xs={3.33} fontSize={35}>
                        Completed
                    </Grid>
                    <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'} minHeight={500}>
                        <Droppable droppableId="droppable1">
                            {(provided) => (
                            <ul
                                {...provided.droppableProps}
                                ref={provided.innerRef}
                                style={{
                                    listStyleType: 'none',
                                    padding: '8px',
                                    margin: '8px',
                                    minHeight:'200px'
                                }}
                            >
                                {provided.placeholder}
                            </ul>
                            )}
                        </Droppable>
                    </Grid>
                    <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>
                        <Droppable droppableId="droppable2">
                            {(provided) => (
                            <ul
                                {...provided.droppableProps}
                                ref={provided.innerRef}
                                style={{
                                    listStyleType: 'none',
                                    padding: '8px',
                                    margin: '8px',
                                    minHeight:'200px'
                                }}
                            >
                                {provided.placeholder}
                            </ul>
                            )}
                        </Droppable>
                    </Grid>
                    <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>

                    </Grid>
                </Grid>
            </DragDropContext>
        </>
    );
}

export default Day;
